import React from 'react';
import './ActivityItem.css';

const ActivityItem = ({ activity }) => {
    const ActivityItem = ({ activity }) => {
        return (
          <div className="activity-item">
            <div className="activity-field"><span className="field-label">Name:</span> {activity.name}</div>
            <div className="activity-field"><span className="field-label">Phone:</span> {activity.phone}</div>
            <div className="activity-field"><span className="field-label">Email:</span> {activity.email}</div>
            <div className="activity-field"><span className="field-label">Amount:</span> ${activity.amount}</div>
            {/* Render icons and additional info based on activity.type */}
          </div>
        );
      };
};

export default ActivityItem;
